import React from 'react';
import {BrowserRouter, NavLink, Routes, Route} from 'react-router-dom';

import Main from '../layouts/main'
import Subnavigation from '../layouts/subnavigation'
import Header from '../layouts/header'
import Body from '../layouts/body'
import '../styles/theme.css'

const Issues = ({className}) => (
  <BrowserRouter>
  <Main className={className}>
  <Subnavigation title='Issues'>
    <NavLink exact to='/issues/all'>All</NavLink>
    <NavLink to='/issues/saved1'>Saved1</NavLink>
    <NavLink to='/issues/saved2'>Saved2</NavLink>
  </Subnavigation>
  <Routes>
    <Route exact path='/issues/all' element={
      <div>
        <Header title='All Issues'>Button</Header>
        <Body>Testing issues body</Body>
      </div>
    }/>
    <Route path='/issues/saved1' element={
      <div>
        <Header title='Saved Issues 1'>Button</Header>
        <Body>Testing issues body</Body>
      </div>
    }/>
    <Route path='/issues/saved2' element={
      <div>
        <Header title='Saved Issues 2'>Button</Header>
        <Body>Testing issues body</Body>
      </div>
    }/>
  </Routes>
</Main>
  </BrowserRouter>
);

export default Issues;
